        _transfer(_msgSender(), recipient, amount);

        if(traderRewardsHookEnabled && !_isExcluded[recipient]){
            ITraderRewards(_traderRewardsAddress).transfer(
                _msgSender(), recipient, amount
            );
        }

        return true;
    }

    function allowance(address source, address spender) public view override returns (uint256) {
        return _allowances[source][spender];
    }

    function approve(address spender, uint256 amount) public override returns (bool) {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function transferFrom(address sender, address recipient, uint256 amount) public override returns (bool) {
