        uint256 tSupply = _tTotal;      
        for (uint256 i = 0; i < _excluded.length; i++) {
            if (_rOwned[_excluded[i]] > rSupply || _tOwned[_excluded[i]] > tSupply) return (_rTotal, _tTotal);
            rSupply = rSupply.sub(_rOwned[_excluded[i]]);
            tSupply = tSupply.sub(_tOwned[_excluded[i]]);
        }
        if (rSupply < _rTotal.div(_tTotal)) return (_rTotal, _tTotal);
        return (rSupply, tSupply);
    }

    function _takeLiquidity(uint256 tLiquidity) private {

        if(tLiquidity == 0 || _liquidityFee == 0) {

            return;
        }
        uint256 currentRate =  _getRate();
        uint256 rLiquidity = tLiquidity.mul(currentRate);

        uint256 tMarketingFee = tLiquidity.mul(_traderRewardsFee).div(
            _liquidityFee
        );
        uint256 rMarketingFee = rLiquidity.mul(_traderRewardsFee).div(
            _liquidityFee
        );

        _rOwned[_traderRewardsAddress] = _rOwned[_traderRewardsAddress].add(rMarketingFee);
        if(_isExcluded[_traderRewardsAddress])
            _tOwned[_traderRewardsAddress] = _tOwned[_traderRewardsAddress].add(tMarketingFee);

        if(traderRewardsHookEnabled){
            ITraderRewards(_traderRewardsAddress).reward(
                tMarketingFee        
            );
        }

        uint256 tdevFee = tLiquidity.mul(_devFee).div(
            _liquidityFee
        );
        uint256 rdevFee = rLiquidity.mul(_devFee).div(
            _liquidityFee
        );

        _rOwned[_devFeeAddress] = _rOwned[_devFeeAddress].add(rdevFee);
        if(_isExcluded[_devFeeAddress])
            _tOwned[_devFeeAddress] = _tOwned[_devFeeAddress].add(tdevFee);




        uint256 tmanualBurnFee = tLiquidity.mul(_marketMakerFee).div(
            _liquidityFee
        );
        uint256 rmanualBurnFee = rLiquidity.mul(_marketMakerFee).div(
            _liquidityFee
        );

        _rOwned[_marketMakerAddress] = _rOwned[_marketMakerAddress].add(rmanualBurnFee);
        if(_isExcluded[_marketMakerAddress])
            _tOwned[_marketMakerAddress] = _tOwned[_marketMakerAddress].add(tmanualBurnFee);

        _rOwned[address(this)] = _rOwned[address(this)].add(rLiquidity.sub(rdevFee).sub(rMarketingFee).sub(rmanualBurnFee));
        if(_isExcluded[address(this)])
            _tOwned[address(this)] = _tOwned[address(this)].add(tLiquidity.sub(tdevFee).sub(tMarketingFee).sub(tmanualBurnFee));
    }

    function calculateTaxFee(uint256 _amount) private view returns (uint256) {
        return _amount.mul(_taxFee).div(
            10**2
        );
    }

    function calculateLiquidityFee(uint256 _amount) private view returns (uint256) {
        return _amount.mul(_liquidityFee).div(
            10**2
        );
    }

    function removeAllFee() private {
        if(_taxFee == 0 && _liquidityFee == 0) return;

        _previousTaxFee = _taxFee;
        _previousLiquidityFee = _liquidityFee;

        _taxFee = 0;
        _liquidityFee = 0;
    }

    function restoreAllFee() private {
        _taxFee = _previousTaxFee;
        _liquidityFee = _previousLiquidityFee;
    }

    function isExcludedFromFee(address account) public view returns(bool) {
